static Boolean strEqual(const void *a, const void *b)
{
    return strcmp(a, b) == 0;
}

static CFHashCode strHash(const void *a)
{
    const char *b = (const char *)a;
    int result = 0;
    while (*b++)
    {
        result += ((result << 8) - result) ^ *b;
    }
    return result;
}

